import React, { } from 'react';
import {
  Link
} from "react-router-dom";

import SwitchComp from './components/switch';

function App() {

  return (

    <div className="App">
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">ContentData</Link>
            </li>
            <li>
              <Link to="/about">About</Link>
            </li>
            <li>
              <Link to="/users">Users</Link>
            </li>
          </ul>
        </nav>


      </div>
      <SwitchComp />
    </div>

  );
}



export default App;


